import React, { useEffect, useState } from "react";

import ResolCSS from '../styles/Resolution.module.css'

export default function ResolutionCheck() {
    let [data, setData] = useState()

    async function getData() {
        let paramId = window.location.pathname.split('/')[2]

        return await fetch(`/resolution/${paramId}/check`).then(r => r.json()).then(r => setData(r))
    }

    useEffect(() => {
        getData()
    }, [])

    return <>
        {data ?
            <div>true</div>
            :
            <div>load</div>
        }
    </>
}
